import React from "react";

export default function Interests() {
    return (
        <section className="interests-section">
            <h2>Interests</h2>
            <p>Other than web development, I am a professional Economist and love to analyse lots of company data with the help of calculus and statistics and other economic concepts. I also love machine learning because I use it a lot to solve economic problems but I can't fully call myself a machine learning engineer because I didn't fully specialise in it.</p>
        </section>
    )
}
